  input: TEXT,F3A,,"9/20/02- This report was amended to include checks for the specified
    coverage period that were received in the campaign office after this report was
    initially submitted.  Also, in response to the inquiry dated September 5, 2002,
    several sections have been amended. Schedule B contains more accurate descriptions
    of the purpose of disbursements. Schedule D contains the nature of the debt owed
    by the Committee to First Commercial Bank. Supporting information is given in
    Schedule C-1. For donors who gave in excess of $200, more complete identification
    has been given. Schedule A of the report contains the 48 hour notices. After a
    complete internal review of all 48 hour notices filed, it was found that checks
    were submitted with the date written on the check, and not the date that the Committee
    actually received the check. Therefore, it may look as if many of the checks that
    were submitted were filed late, when in essence they were not. For instance, for
    the 5/31/02 48 hour notice filing, the check was written on 5/24/02, received
    in the office on 5/31/02, but filed with the date of 5/24/02.  For the 5/30/02
    filing, checks were written between the dates of 5/22/02-5/23/02, received on
    5/30/02, but filed with the dates written on the checks."
